import ExpenseItem from "./ExpenseItem"
const ExpenseList = props => {
    if(props.items.length === 0) {
        return <h2 className="expenses-list_fallback">Found no expenses</h2>
    }

    return (
        <ul className="">
        {    filteredExpenses.map((expense) => (
      <ExpenseItem
        key = {expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      ></ExpenseItem>
    ))}
        </ul>
    )
}
